import React, { useEffect, useState } from "react";

const Jodoh = () => {
  const [gas, setgas] = useState(false);
  useEffect(() => {
    setgas(true);
    if (gas) {
      console.log("gasss");
    } else {
      console.log("upps");
    }
  });

  return (
    <div>
      <h1>{gas}</h1>
    </div>
  );
};

export default Jodoh;
